      params: { query: term },
      headers: {
        Authorization: "Client-ID i2n8c8TVPCzuzcNUpdYjxNWrAxyqJFR3TwtgCbPYeuk"
      }
    });

    console.log(response.data.results)
  }

  render() {
    return (
      <div className="ui container" style={{ marginTop: "10 px" }}>
        <SearchBar onSubmit={this.onSearchSubmit} />
      </div>
    );
  }
}

